import React from 'react';

function FeaturesSection() {
  return (
    <section className="features">
      <h2>Características</h2>
      <ul>
        <li>Fácil de usar</li>
        <li>Altamente personalizable</li>
        <li>Soporte técnico 24/7</li>
      </ul>
    </section>
  );
}

export default FeaturesSection;
